import * as React from 'react';
import styled from '../../../utils/styled';
import classNames from "classnames";
import SquadronModel from "../../../store/squadrons/SquadronModel";

interface RowProps {
    column1: string;
    active: boolean;
    clickItem: () => void;
    column2?: string
    className?: string;
}

const ItemRow: React.FC<RowProps> = ({column1, active, column2, clickItem, className}) => (
    <Wrapper
    >
        {!active ? (<ActiveRows
            className={classNames('MenuItemRow', className)}
            onClick={clickItem}>
            <Column>
               {column1}
            </Column>
            <Column>
              {column2}
            </Column>
        </ActiveRows>) : (<InActiveRows>
            <Column>
                {column1}
            </Column>
            <Column>
                {column2}
            </Column>
        </InActiveRows>)}
    </Wrapper>
);

export default ItemRow;

export const Wrapper = styled('div')`
display: flex;
flex-direction: row;
//cursor: pointer;
//color: rgba(255, 255, 255, 0.3);
//font-size: 16px;
width: 100%;
padding-left: 20px;
`;

const Column = styled('span')`
  display: flex;
  flex-direction: row;
  justify-content: flex-start;
  width: 100%;
`;


const ActiveRows = styled('div')`
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  align-content: center;
  cursor: pointer;
  color: rgba(255, 255, 255, 0.3);
  font-size: 16px;

`;
const InActiveRows = styled('div')`
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  cursor: default;
  color: rgba(255, 255, 255, 0.1);
  font-size: 16px;
`;
